window.bookSummaryJSON = "<p><i>Legal Immigrant</i> is Alan Cumming's collection of musings on his experiences as a US citizen, growing older, and what it feels like to be an immigrant in today's America, featuring songs and stories that are as eclectic and idiosyncratic as Alan himself. The audio, recorded live at the Minetta Lane Theatre, is a smorgasbord of genres, styles, and tales. Replete with laughter, tears and, of course, provocation, featuring covers of songs made famous by a diverse array of musical legends.</p> <p>Experience this title in immersive 3D audio by <a href=\"https://help.audible.com/s/article/how-can-i-change-the-download-format-settings-in-the-audible-for-android-and-audible-for-ios-apps/\">setting your download quality to High</a> within the app. Headphones recommended. For more, browse our <a href=\"https://www.audible.com/ep/3d-audio\">entire collection of 3D audio listens</a>.</p> <p>Now available in Dolby Atmos on Audible.</p>"; 
